import React from "react";
import { View, Text, FlatList } from "react-native";
import repositories from "../data/repositories.js";
import StyledText from "./StyledText.jsx";

const Repositories = (props) => {
  return (
    <FlatList
      data={repositories}
      item
      renderItem={({ item: repo }) => (
        <View key={props.id}>
          <StyledText bold> ID: {repo.id}</StyledText>
          <StyledText primary> FULLNAME: {repo.fullName}</StyledText>
          <StyledText primary> DESCRIPTION: {repo.description}</StyledText>
          <StyledText primary> LANGUAGE: {repo.lenguage}</StyledText>
          <StyledText primary> START: {repo.stargazersCount}</StyledText>
          <StyledText primary> FORKS: {repo.forksCount}</StyledText>
          <StyledText primary> REVIEW: {repo.reviewCount}</StyledText>
          <StyledText primary> RATING: {repo.ratingAverage}</StyledText>
        </View>
      )}
    ></FlatList>
  );
};

export default Repositories;
